@matt_levinson National Film &amp; Sound Archive #NFSA exhibition &amp; theatres are great…the exhibitions change so check before you go. 
I’ve taken a few senior PS groups there &amp; they loved it. 
Fabulous Art Deco building

@britishlibrary @soundarchive It's really interesting. Also in our sound archive at the ICBSA we keep a collection of recordings of the 'Parable of the Prodigal Son' in different Italian dialects, made starting in 1963. Some examples here https://t.co/YJhrQTyg9T
